-- ----------------------------
-- Table structure for yw_store
-- ----------------------------
DROP TABLE IF EXISTS `yw_store`;
CREATE TABLE `yw_store` (
`id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'id' ,
`store_mc`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '仓库名称' ,
`parent_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '父id' ,
`store_code`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '510123000000' COMMENT '仓库码' ,
`deleted`  tinyint(1) NULL DEFAULT 0 COMMENT '是否删除' ,
`crate_time`  datetime NULL DEFAULT NULL COMMENT '创建时间' ,
`update_time`  datetime NULL DEFAULT NULL COMMENT '更新时间' ,
`store_unit_name`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '储物柜全名' ,
`store_contro`  varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '0为非智能柜，与store_mc同值' ,
`sort`  int(11) NULL DEFAULT NULL COMMENT '排序列' ,
`store_tree_type`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '是否有子柜子' ,
`left_value`  int(10) UNSIGNED NULL DEFAULT NULL COMMENT '左值' ,
`right_value`  int(10) UNSIGNED NULL DEFAULT NULL COMMENT '右值' ,
PRIMARY KEY (`id`),
INDEX `UK_PARENT` USING BTREE (`parent_id`),
INDEX `store_tree_type` USING BTREE (`store_tree_type`),
INDEX `left_value` USING BTREE (`left_value`),
INDEX `right_value` USING BTREE (`right_value`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='仓库储物柜'

;

